import './Form.css'

const Form = () =>{
    return(
        <div id="form-body">
            <form>
                Name :<input type="text" placeholder="ENTER YOUR NAME"></input>
                Email : <input type="email"></input>
                Phone No :<input type="number" type="text"></input>
                Anything You Want To Tell : <input type="text"></input>
            </form>

        </div>
    )
}

export default Form;
